import './App.css';
import React from 'react';

class Register extends React.Component {
    render() {
        return (
            <div className="App">
                <form>
                    <span className="formtext"></span>
                        <input 
                        type="text" 
                        placeholder="Enter Company Name" 
                        required 
                        />
                        <button>Submit</button>
                </form>
            </div>
        );
    }
}

export default Register;
